import kitty from './kitty-icon.svg'

import './SideInfo.css';

function SideInfo() {
  return (
    <div className="side-info">
      <img src={kitty} className="info-icon" alt="kitty-icon"></img>
    </div>
  );
}

export default SideInfo;
